import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <div className="card">
        <img
          src={require("../IMG-5355.jpg")}
          alt=""
          class="img-thumbnail w-25"
        />
        <div className="card-body">
          <p>Service Booking</p>
        </div>
      </div>
    );
  }
}

export default Header;
